import styled from "styled-components";

export default function Footer() {
  return (
    <Bottom>
      <div className="box">
        <span>List</span>
        <div className="main">
         Pets
        </div>
        <span>Health</span>
      </div>
    </Bottom>
  );
}

const Bottom = styled.div`
  width: 100%;
  height: 80px;
  position: fixed;
  background-color: #555;
  bottom: 0;
  box-shadow: 0 4px 4px 0 rgba(0, 0, 0, 0.25);
  display: flex;
  padding: 30px;

  .box {
    display: flex;
    width: 100%;
    justify-content: space-between;
    align-items: center;
  }
  .main {
    width: 91px ;
  height: 91px;
  border-radius: 50%;
  background-color: var(--darkcolor);
  font-size: 18px;
  display: flex;
